'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class SendStopOrderForTradeCommand extends SendSingleCommandWithoutResponse {
    stopOrderRequest;
    openPosition;
    constructor() {
        super();
        this.commandName = "SendStopOrderForTradeCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createStopOrderForTradeRequestMessage(this.tradingSession, this.stopOrderRequest, this.openPosition, this.requestNumberGenerator, stdlib.nowutc());
    }
}
module.exports = SendStopOrderForTradeCommand
